import React from "react";
import LecturesListItem from "./LecturesListItem";
import { connect } from "react-redux";

const LecturesList = ({ subjects }) => {
  return (
    <>
      {subjects.map((subject) => (
        <LecturesListItem
          key={subject.id}
          name={subject.name}
          code={subject.code}
        />
      ))}
    </>
  );
};

const mapStoreStateToProps = ({ subjects }) => {
  return {
    ...subjects,
  };
};

export default connect(mapStoreStateToProps)(LecturesList);
